script: |
  super -f text -I q115.spq | sort > q115.out

inputs:
  - name: q115.spq
    data: |
      SELECT ALL + ( col2 ) AS col0 FROM tab1 (FORMAT parquet) WHERE NOT - - 49 IN ( - - col1 - - ( + - col0 ) * - col1 + + + 55, - 42 + + col0 * + ( + col2 ) );
  - name: tab1

outputs:
  - name: q115.out
    data: |
      59
      68
      96
